import { Container } from "react-bootstrap";

const Footer = () => {
  return (
    <footer className="bg-dark text-white py-3">
      <Container className="text-center">
        <p>&copy; 2024 Movie Info Viewer. All rights reserved.</p>
      </Container>
    </footer>
  );
};

export default Footer;
